n// Common editors\nexport type CircleEditor = Editor;\nexport type CCircleEditor = CEditor;\n\nexport type PolyEditor = Editor;\nexport type CPolyEditor = CEditor;\n\nexport type EllipseEditor = Editor;\nexport type CEllipseEditor = CEditor;\n\nexport type RectangleEditor = Editor;\nexport type CRectangleEditor = CEditor;\n\n    \n\n\n\n\n\n\n                   \n    \n         results matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"classes/EventBinder.html":{"url":"classes/EventBinder.html","title":"class - EventBinder","body":"\n                   \n\n\n\n\n\n\n\n\n\n\n  Classes\n  EventBinder\n\n\n\n    \n        Info\n    \n\n\n    \n        Source\n    \n\n\n\n    \n        \n            File\n        \n        \n            projects/ngx-amap/src/utils/event-binder.ts\n        \n\n\n\n\n\n            \n    Index\n    \n        \n\n                \n                    \n                        Methods\n                    \n                \n                \n                    \n                        \n                            \n                                bindEvent\n                            \n                        \n                    \n                \n\n\n\n\n\n        \n    \n\n\n\n\n            \n    \n        \n            Methods\n        \n        \n            \n                \n                    \n                        \n                        \n                            \n                            bindEvent\n                            \n                            \n                        \n                    \n                \n                \n                    \nbindEvent(target: Promise | T, event: string)\n                    \n                \n\n\n                        \n                            \n                                    Defined in projects/ngx-amap/src/utils/event-binder.ts:7\n                            \n                        \n\n                \n                    \n\n                            \n                                    Parameters :\n                                    \n                                        \n                                            \n                                                Name\n                                                    Type\n                                                Optional\n                                            \n                                        \n                                        \n                                                \n                                                        target\n                                                        \n                                                                    Promise | T\n                                                        \n                                                    \n                                                    \n                                                            no\n                                                    \n                                                    \n\n                                                \n                                                \n                                                        event\n                                                        \n                                                                    string\n                                                        \n                                                    \n                                                    \n                                                            no\n                                                    \n                                                    \n\n                                                \n                                        \n                                    \n                            \n                            \n                            \n                            \n                                Returns :     Observable\n\n                            \n                                \n                                    \n                                \n                    \n                \n            \n        \n\n\n\n\n\n\n\n    \n\n\n    \n        import { Observable } from 'rxjs';\nimport { AMapClass } from '../types/class';\ndeclare const AMap: AMapClass;\n\nexport class EventBinder {\n\n  bindEvent(target: Promise | T, event: string): Observable {\n    if (target instanceof Promise) {\n      return Observable.create(observer => {\n        let listenerPromise = target.then(m => {\n          return AMap.event.addListener(m, event, e => {\n            setTimeout(() => observer.next(e));\n          }, this);\n        });\n\n        return () => {\n          listenerPromise.then(listener => {\n            AMap.event.removeListener(listener);\n            listenerPromise = null;\n          });\n        };\n      });\n    } else {\n      return Observable.create(observer => {\n        let listener = AMap.event.addListener(target, event, e => {\n          setTimeout(() => observer.next(e));\n        }, this);\n\n        return () => {\n          AMap.event.removeListener(listener);\n          listener = null;\n        };\n      });\n    }\n  }\n\n}\n\n    \n\n\n\n\n\n\n\n                   \n    \n         results matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"interfaces/Geocode.html":{"url":"interfaces/Geocode.html","title":"interface - Geocode","body":"\n                   \n\n\n\n\n\n\n\n\n\n\n\n  Interfaces\n  Geocode\n\n\n\n    \n        Info\n    \n\n\n    \n        Source\n    \n\n\n\n    \n        \n            File\n        \n        \n            projects/ngx-amap/src/types/class/geocoder/geocode.ts\n        \n\n\n\n        \n            Index\n            \n                \n                    \n                        \n                            Properties\n         